        nodes = new vis.DataSet([{"color": "#377eb8", "id": "1980-1990_fj\u00e6r_10", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eBaerumsjegerne fikk en laerkask med et smalt messingb\u00e5nd til\u003cbr\u003enedre kant og riflet og fliket messingskilt i fronten og en gr\u00f8nn,\u003cbr\u003etvunne\u003cb\u003et fj\u003c/b\u003eaer som en \u00abkam\u00bb, langs pulle\u003cspan style=\"color:#808080;\"\u003en .\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_fj\u00e6r_10\u003cbr\u003etype: usage\u003c/p\u003e", "x": -84.14775460389508, "y": -193.9946988682816}, {"color": "#377eb8", "id": "2012-2019_fj\u00e6r_59", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMen for Mazda er det en \u003cb\u003efjae\u003c/b\u003er i hatten \u00e5 komme seg s\u00e5\u003cbr\u003eh\u00f8yt, med noen unntak er vel merket tradisjonelt ikke det vi mest\u003cbr\u003eforbinder med lekkert design. Ikke s\u00e5 fint inni helle\u003cspan style=\"color:#808080;\"\u003er\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_fj\u00e6r_59\u003cbr\u003etype: usage\u003c/p\u003e", "x": -99.29441913992355, "y": -93.97060899894932}, {"color": "#377eb8", "id": "2012-2019_fj\u00e6r_1044", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet f\u00f8rte til at fristen 31. oktober ikke blir m\u00f8tt, slik\u003cbr\u003eJohnson har lovet. * Torsdag kom Johnsons beskjed om at han \u00f8nsker\u003cbr\u003evalg 12. desember. Mistet flertallet At flertallet stemte for\u003cbr\u003eprinsippene rundt avtalen er en \u003cb\u003efjae\u003c/b\u003er i hatten for Johnson \u2013\u003cbr\u003edet er f\u00f8rste gang et flertall har vist seg for noen brexit-avtalen \u2013\u003cbr\u003emen det betyr ikke at avtalen n\u00f8dvendigvis vil g\u00e5 gjennom i en endelig\u003cbr\u003ebehandling av lovgivningen rundt det \u2013 dersom Johnson g\u00e5r videre med \u00e5\u003cbr\u003ef\u00e5 gjennom avtalen. \u00c5rsaken er at parlamentsmedlemmer da kan se sitt\u003cbr\u003esnitt til \u00e5 legge til endringsforslag for \u00e5 endre planen, enten til en\u003cbr\u003emykere brexit eller ved at den st\u00f8ttes under forutsetning av at den\u003cbr\u003elegges fram for en folkeavstemning og der blir godkjent av\u003cbr\u003efolket\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_fj\u00e6r_1044\u003cbr\u003etype: usage\u003c/p\u003e", "x": 40.07243022603457, "y": -180.06167025220017}, {"color": "#377eb8", "id": "1980-1990_fj\u00e6r_15", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e- Frem sprengte s\u00e5 greven av Provence, med \u003cb\u003efjae\u003c/b\u003er i\u003cbr\u003ebaretten og den vide grevek\u00e5pe langt utover den veldige hests sider.\u003cbr\u003e\u00abHill, hill greven av Provence - hill, hill Daniel Falbe!\u00bb - Greven av\u003cbr\u003eProvence vinket med sin behanskede hand og red statelig ut av\u003cbr\u003eHerbyg\u00e5rdens port, og ved hans side red den unge Raimund av Lusignan -\u003cbr\u003eennu med den r\u00f8de nellik under ansiktet\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_fj\u00e6r_15\u003cbr\u003etype: usage\u003c/p\u003e", "x": -99.57035873775908, "y": 10.230726114317777}, {"color": "#377eb8", "id": "1980-1990_fj\u00e6r_2", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\"Det er imidlertid ofte vanskelig \u00e5 avgj\u00f8re\u003cbr\u003ekollisjonstidspunktet ettersom\u003cb\u003e fja\u003c/b\u003eer i sn\u00f8 synes \u00e5 holde seg\u003cbr\u003e\"\"ferske\"\" over en viss tid. Unders\u00f8kelsesomr\u00e5det ligger i et\u003cbr\u003eattraktivt utfartsterreng med relativt mange fritidsboli\u003cspan style=\"color:#808080;\"\u003eger.\"\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_fj\u00e6r_2\u003cbr\u003etype: usage\u003c/p\u003e", "x": -119.586591904579, "y": 263.5563857037191}, {"color": "#377eb8", "id": "1980-1990_fj\u00e6r_6", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eJeg synes jeg er som en duvende \u003cb\u003efjae\u003c/b\u003er JORDENS DR\u00d8M\u003cbr\u003eVester\u00e5sbukte\u003cspan style=\"color:#808080;\"\u003en\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_fj\u00e6r_6\u003cbr\u003etype: usage\u003c/p\u003e", "x": 133.15769372980958, "y": 9.54798718654861}, {"color": "#377eb8", "id": "1980-1990_fj\u00e6r_7", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e2.2.2 Dyner og \u0027puter. Fyllmateriale av dun og \u003cb\u003efjae\u003c/b\u003er\u003cbr\u003eblir fremdeles mye brukt, men ogs\u00e5 kunstfibrer, f\u00f8rst og fremst\u003cbr\u003epolyesterfibrer er meget vanlig\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_fj\u00e6r_7\u003cbr\u003etype: usage\u003c/p\u003e", "x": 167.98031819201262, "y": 102.3687545876348}, {"color": "#377eb8", "id": "2012-2019_fj\u00e6r_192", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e- Det er en stor \u003cb\u003efjae\u003c/b\u003er i hatten ogs\u00e5 for trenere \u00e5 gj\u00f8re\u003cbr\u003edet bra her. Resultater er en ting, men m\u00e5ten man spiller p\u00e5, slik som\u003cbr\u003eNorge som gj\u00f8r, ved \u00e5 kombinere offensiv kraft og finesse med defensiv\u003cbr\u003eorganisering, blir lagt merke til, sier Semb. Boble Men Skullerud vil\u003cbr\u003eikke h\u00f8re snakk om hva som skjer etter EM. - Vi er i boblen her nede,\u003cbr\u003eog der skal vi vaer\u003cspan style=\"color:#808080;\"\u003ee.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_fj\u00e6r_192\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1.6463385053635289, "y": 159.1547006097718}, {"color": "#377eb8", "id": "2012-2019_fj\u00e6r_935", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e- Dette er en \u003cb\u003efjae\u003c/b\u003er i hatten, ikke bare for oss, men for\u003cbr\u003ehele kultur-Norge\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_fj\u00e6r_935\u003cbr\u003etype: usage\u003c/p\u003e", "x": -164.77351460943004, "y": 125.84018877614767}, {"color": "#377eb8", "id": "1980-1990_fj\u00e6r_9", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eSer vi ogs\u00e5 p\u00e5 gamle Baerumsjegerne i grev Wedels tid hadde\u003cbr\u003estas\u0026lt; hodeplagg, laerkask med gr\u00f8n\u003cb\u003en fj\u003c/b\u003eaer bilder av\u003cbr\u003efestligheter p\u00e5 Baerums Verk, ser vi enkelte uniformerte personer som\u003cbr\u003em\u00e5 vaere offis\u003cspan style=\"color:#808080;\"\u003eerer.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_fj\u00e6r_9\u003cbr\u003etype: usage\u003c/p\u003e", "x": -78.50897216921402, "y": 168.83447105272498}, {"color": "#377eb8", "id": "1980-1990_fj\u00e6r_14", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e- Hvem visste hvad tiden gav - en gang n\u00e5r Rikka Gan kom\u003cbr\u003etilbake - - pauker og trommer, Rikka Torsen, - menn p\u00e5 hvite hester og\u003cbr\u003efruer med flagrende \u003cb\u003efjae\u003c/b\u003er - - fakler og blomster h\u00f8it omkring\u003cbr\u003eGan - og silkebetrukne vegger. - Hvad er umulig, Rikka Torsen, for\u003cbr\u003eden, som er sterk, den som har vilje, skj\u00f8nnhet, ungdom og list? -\u003cbr\u003eList som en slange imellem torner\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_fj\u00e6r_14\u003cbr\u003etype: usage\u003c/p\u003e", "x": -231.61476706517547, "y": 74.42959094273384}, {"color": "#377eb8", "id": "1980-1990_fj\u00e6r_13", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI 1976 var avtalen med kommunen oppfylt, og Vellet kunne sette\u003cbr\u003eenda en \u003cb\u003efjae\u003c/b\u003er i hatten. Fra da av har opgaven bare vaert \u00e5 f\u00e5\u003cbr\u003esupplerende belysning p\u00e5 enkelte m\u00f8rke steder, samt \u00e5 varsle e-verket\u003cbr\u003eom utbrente lampe\u003cspan style=\"color:#808080;\"\u003er.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_fj\u00e6r_13\u003cbr\u003etype: usage\u003c/p\u003e", "x": -208.99093290570067, "y": -209.139969966421}, {"color": "#377eb8", "id": "2012-2019_fj\u00e6r_343", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDen eller de som utf\u00f8rte ud\u00e5den er enn\u00e5 ikke tatt. Fenerbahce\u003cbr\u003evant kampen 2-1. Den mektige hjemmebanen S\u00fckr\u00fc Saracoglu var et vilt\u003cbr\u003ekok. Vinner serien Seieren var en \u003cb\u003efjae\u003c/b\u003er i hatten for laget p\u00e5\u003cbr\u003eAsia-siden av Istanbul. Galatasaray vinner likevel den tyrkiske serien\u003cbr\u003emed klar margin\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_fj\u00e6r_343\u003cbr\u003etype: usage\u003c/p\u003e", "x": 53.29197845263447, "y": -74.55489096453982}, {"color": "#377eb8", "id": "2012-2019_fj\u00e6r_847", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet l\u00e5 ubeskyttet i flere timer, f\u00f8r ei stokkand gikk inn for\u003cbr\u003elanding og la seg til \u00e5 ruge. - Jeg hadde plantet stemor til\u003cbr\u003emaidagene, men alt var r\u00f8sket opp for \u00e5 gj\u00f8re plass til egget. Sist\u003cbr\u003ejeg telte l\u00e5 det \u00e5tte egg der, og n\u00e5 har hun brukt andre planter fra\u003cbr\u003everandaen og sine egne \u003cb\u003efjae\u003c/b\u003er til \u00e5 dekke dem til. \u00abFjaerballer\u003cbr\u003emed luft\u00bb N\u00e5 ligger anda mesteparten av dagen i fred og ro ruger, med\u003cbr\u003eutsikt mot friidrettsanlegget og Nidelva. N\u00e5r klokka naermer seg \u00e5tte,\u003cbr\u003etar hun vingene fatt for en kveldst\u003cspan style=\"color:#808080;\"\u003eur.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_fj\u00e6r_847\u003cbr\u003etype: usage\u003c/p\u003e", "x": -19.721247863020988, "y": -250.0459003079763}, {"color": "#377eb8", "id": "2012-2019_fj\u00e6r_417", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cb\u003eFjae\u003c/b\u003er fra utrydningstruet fugl brukes i fiskefluer som\u003cbr\u003eselges over disk i Norge. Foto: Frank Lervi\u003cspan style=\"color:#808080;\"\u003ek\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_fj\u00e6r_417\u003cbr\u003etype: usage\u003c/p\u003e", "x": 256.86752831387474, "y": -73.11550009211463}, {"color": "#377eb8", "id": "1980-1990_fj\u00e6r_5", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDog ogs\u00e5 dette er mildt og godt, der er lise og fred i b\u00f8lger\u003cbr\u003eog brott og lykke for \u00f8iet i havets bl\u00e5tt. Livet har ting s\u00e5 lette som\u003cbr\u003e\u003cb\u003efjae\u003c/b\u003er og dyp som i fred kommer d\u00f8den naer. 81 Nypetornen i\u003cbr\u003egjaerdet st\u00e5r nu s\u00e5 veldig i hvidt at den dekker det svarte skjaeret\u003cbr\u003eog havgapet milevidt. Det er kun en sommeruke, s\u00e5 ser jeg fra samme\u003cbr\u003esten som gjennem en apen luke et brott bak hvereneste g\u003cspan style=\"color:#808080;\"\u003eren!\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_fj\u00e6r_5\u003cbr\u003etype: usage\u003c/p\u003e", "x": 4.639489013989299, "y": 22.763210477057882}, {"color": "#377eb8", "id": "2012-2019_fj\u00e6r_629", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet er jo en \u003cb\u003efjae\u003c/b\u003er i hatten til oss, n\u00e5 som\u003cbr\
